import React from 'react';
import { BrowserRouter as Router, Route, Switch, Redirect } from 'react-router-dom';
import RegistrationForm from './components/Register'; // Assuming your registration form component is in RegistrationForm.js
import Dashboard from './components/Dashboard'; // Assuming your dashboard component is in Dashboard.js

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/register" component={RegistrationForm} />
        <Route exact path="/dashboard" component={Dashboard} />
        <Redirect to="/register" />
      </Switch>
    </Router>
  );
}

export default App;
